import React from 'react'
import {Link} from 'react-router-dom'
import './Card.css'

export default function Card({country}) {
  return (
    // <div className='countryCard'>
      
    //     <Link to={'/home/' + country.id}>
    //       <img className='img' src={country.flag} alt={country.name} width={230} height={145} />
    //       <div>
    //         <h3>{country.name}</h3>
    //       </div>
    //       <h5>{country.continent}</h5>
    //     </Link>
      
    // </div>
    <div class="container">
      <Link to={'/home/' + country.id}>
      <div class="card">
          <div class="slide slide1">
              <div class="content">
                  <div class="icon">
                      <img class="fa fa-user-circle" aria-hidden="true" src={country.flag} alt={country.name} width={269} height={170} />
                  </div>
              </div>
          </div>
          <div class="slide slide2">
              <div class="content">
                  <h3>
                  {country.name}
                  </h3>
                  <p>{country.continent}</p>
              </div>
          </div>
      </div>
      </Link>
    </div>
  )
}
